import React, { useState, useEffect } from 'react';
import './PendingTracking.css';
import { tracking } from './MOCK_DATA';




function PendingTracking() {

  const [items, setItems] = useState([]);

  useEffect(() => {
    setItems(tracking);
  }, [])

  return (
    <div className='card'>
      <div className='card__header'>
        <p>Pending Tracking</p>
      </div>
      {/* {(items.length === 0) && <p className='card__content' style={{ color: "rgb(100, 100, 100)" }}>No item.</p>} */}
      {
        items.map(item => <div className='card__content'>
          <p>{item.address}</p>
        </div>)
      }
    </div>
  )
}

export default PendingTracking
